  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0124206 contains raw underway
  meteorological, navigational, optical, physical and time series data logged by the
  Scientific Computer System (SCS) aboard NOAA Ship Oscar Dyson in the Coastal Waters
  of SE Alaska, Gulf of Alaska and North Pacific Ocean from 2013-09-24 to 2013-11-03.
  Office of Marine and Aviation Operations (OMAO) personnel aboard the ship submitted
  these data and associated metadata to NODC. In addition, NODC Accession 0124206
  contains supplementary cruise-level metadata, which OMAO personnel logged in the
  Ship Daily Activity Log (SDAL). OMAO and NODC personnel developed the automated
  process to archive these data under the auspices of the NOAA Rolling Deck to Repository
  (NOAA R2R) program.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
